import React from 'react';
import styles from './TestForm.module.scss';
import { Answer, IQuestion, Result, Test } from '../../stores/testStore';
import { useForm, submitHandler } from 'react-hook-form';

/*name: '',
description: '',
author: '',
questions: [],
results: [],
score: 0,
likes: 0,
comments: [],
createdAt: new Date(),
isUpdated: []*/

type FormValues = {
    name: string,
    description: string,
    questions: IQuestion[],
    results: Result[]
}


export default function TestForm() {
    const { register, handleSubmit } = useForm<FormValues>({
        mode: 'onBlur'
    });



    function onSubmit(data: FormValues) {
        console.log(data);
    }

    return (
        <form className={styles.form} onSubmit={handleSubmit(onSubmit)}>
            <div className={styles.formGroup}>
                <label htmlFor="name">Name</label>
                <input type="text" id="name" {...register('name', {required: 'This field is required'})}/>
            </div>

            <div className={styles.formGroup}>
                <label htmlFor="description">Description</label>
                <textarea id="description" {...register('description', {required: 'This field is required'})} />
            </div>



            <button type="submit">Save Test</button>
        </form>
    );
};
